import React from "react";
import Modal from "../Modal";
class TemplateShow extends React.Component {
  render() {
    const idOfTemplate = this.props.match.params.id;
    return (
      <div>
        <Modal id={idOfTemplate} />
      </div>
    );
  }
}

export default TemplateShow;
